import {Cart } from "./pages/cart/cart"
function App() {
  return (
    <div ClassName="App"><Router>
      <Navbar/>
      <Routes>
        <Route path ="/" element={<Shop/>}/>
        <Route path ="/ cart"  element={<Cart/>}/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
